import React from "react";
import { Typography, Button, ButtonGroup, Container } from "@mui/material";
import AcUnitOutlinedIcon from "@mui/icons-material/AcUnitOutlined";
import AccessTimeFilledOutlinedIcon from "@mui/icons-material/AccessTimeFilledOutlined";

export default function Create() {
  return (
    <Container>
      <Typography
        variant="h6"
        component="h2"
        color="textSecondary"
        gutterBottom
      >
        Create a New Note
      </Typography>
      <Button
        variant="contained"
        color="secondary"
        type="submit"
        onClick={() => {
          console.log("button cloicked");
        }}
        startIcon={<AcUnitOutlinedIcon />}
        endIcon={<AccessTimeFilledOutlinedIcon color="primary" />}
      >
        Submit
      </Button>
      <br />
      <AcUnitOutlinedIcon />
      <br />
      <AccessTimeFilledOutlinedIcon color="secondary" fontSize="large" />
      <br />
      <AcUnitOutlinedIcon color="primary" fontSize="small" />
    </Container>
  );
}
